webpackJsonp([5340359618668],{372:function(e,n){e.exports={data:{post:{html:'<h1 id="help-for-manual-installation"><a href="#help-for-manual-installation" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Help for manual installation</h1>\n<p>As pointed out on the install page, this script is not maintained anymore.\nUse it at your own risk and only if you have nothing already running on your server.\nThat script do/docs/install/esn\'t secure your server, thus installing fail2ban and changing SSH default port could be a good idea.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>    #!/bin/sh\n\n    #That script :\n    # 1. Defines the main steps through functions. \n    # 2. Calls them\n\n   #\n   # Initialize the environnment by updating server and installing apache2, php and several requirements\n   #\n   init() {\n\n       apt-get update\n       apt-get -y upgrade\n       apt-get install -y git apache2 unzip\n       #Install php\n       apt-get install -y php libapache2-mod-php php-mcrypt php-mysql php-xml\n\n   }\n\n\n   #\n   # Create a new user and register Jeyser\'s subdomain.\n   #\n   configure_user(){\n\n       echo "For security reasons, we will create a new user and avoid root login through SSH.\n        New user\'s name ?"\n       read new_user\n\n       while [ $new_password != $new_password_confirmation ] || [ $new_password == "" ];  do\n           echo "Mot de passe du nouvel utilisateur ?"\n           read new_password\n           echo "Confirmation du mot de passe ?"\n           read new_password_confirm\n           if  [ $new_password != $new_password_confirm ]; then\n               echo "Passwords don\'t match, retry. "\n           fi\n       done\n\n       useradd -m -d "/home/$new_user/" -s /bin/bash $new_user\n       echo $new_password | passwd $new_user\n       adduser $new_user sudo\n       adduser $new_user www-data\n\n       echo "Jeyser CRM sub domain ?"\n       read sub_domain\n   }\n\n   #\n   # Configure Apache :\n   # - Give PHP files the highest priority.\n   # - Activate mod_rewrite for URL Rewriting.\n   # - Change DocumentRoot to where Jeyser will be installed.\n   #\n   configure_apache(){\n       sed -i \'s/DocumentRoot \\/var\\/www\\/html/DocumentRoot \\/var\\/www\\/html\\/Incipio\\/web/g\' /etc/apache2/sites-enabled/000-default.conf\n       cat > /etc/apache2/mods-enabled/dir.conf <<\'endmsg\'\n   <IfModule mod_dir.c>\n       DirectoryIndex index.php index.html index.cgi index.pl index.xhtml index.htm\n   </IfModule>\n   endmsg\n       a2enmod rewrite\n       service apache2 restart\n   }\n\n   #\n   # Install Mysql and secure installation (executed commands are the same that mysql_secure_installation would give)\n   # Create a mysql user for Jeyser\n   #\n   install_mysql(){\n   echo -e "\\033[36m Heads Up !\n          We are going to set up the database. It is where all informations will be stored. We will create 2 accounts :\n           - An administrator account : root\n           - A user with limited access for Jeyser : incipio.\n           Carefully write the passwords you will choose for root and incipio because they will protect all your data.\n\n           Press return to confirm.\\e[0m "\n   read validation\n   apt-get install -y mysql-server\n\n   #create a mysql user with limited rights on only one db\n\n   cat > ./mysql_secure_installation.sql <<\'endmsg\'\n   DELETE FROM mysql.user WHERE User=\'root\' AND Host NOT IN (\'localhost\', \'127.0.0.1\', \'::1\');\n   DROP DATABASE IF EXISTS test;\n   DELETE FROM mysql.db WHERE Db=\'test\' OR Db=\'test\\\\_%\';\n   FLUSH PRIVILEGES;\n   endmsg\n   echo "\\033[33m Type your mysql root password \\e[0m"\n   mysql -u root -p < mysql_secure_installation.sql\n   rm ./mysql_secure_installation.sql\n\n   cat > ./install.sql <<\'endmsg\'\n   create database incipio;\n   grant usage on *.* to incipio@localhost identified by \'incipiopass\';\n   grant all privileges on incipio.* to incipio@localhost;\n   Flush privileges;\n   endmsg\n   echo "\\033[33m Type your mysql root password again\\e[0m "\n   mysql -u root -p < install.sql\n   rm ./install.sql\n\n   }\n\n   #install composer.\n   install_composer(){\n       cd /var/www/html\n       EXPECTED_SIGNATURE=$(wget -q -O - https://composer.github.io/installer.sig)\n       php -r "copy(\'https://getcomposer.org/installer\', \'composer-setup.php\');"\n       ACTUAL_SIGNATURE=$(php -r "echo hash_file(\'SHA384\', \'composer-setup.php\');")\n\n       if [ "$EXPECTED_SIGNATURE" != "$ACTUAL_SIGNATURE" ]\n       then\n           >&2 echo \'ERROR: Invalid installer signature\'\n           rm composer-setup.php\n           break\n       fi\n\n       php composer-setup.php --quiet\n       RESULT=$?\n       rm composer-setup.php\n       if [ ! -f ./composer.phar ]; then\n           echo "Composer not installed, trying with repository version"\n           apt-get install -y composer\n       fi\n\n       mv ./composer.phar /usr/local/bin/composer\n       echo "You should see Composer version just below. Press Enter to continue."\n       composer --version\n\n       read validation\n   }\n\n\n   install_jeyser(){\n\n       #install jeyser\n       cd /var/www/html\n       git clone https://github.com/n7consulting/Incipio.git\n       cd Incipio\n\n       #installation of php dependencies for production.\n       composer install --no-dev\n\n       #should display symfony version.\n       php app/console --version\n\n       #let\'s go for db setup !!\n\n       php app/console doctrine:schema:update\n       php app/console doctrine:fixtures:load -n\n       php app/console assets:install\n\n       #Make newly created user the owner of all that\n       chown -R $new_user /var/www/html/Incipio\n       chgrp -R www-data /var/www/html/Incipio\n   }\n\n   install_ssl(){\n       #on configure openssl\n       a2enmod ssl\n       apt-get install -y python-letsencrypt-apache\n       service apache2 restart\n   }\n\n\n   echo "\n   Welcome on Jeyser installation script.\n   IT IS DESIGNED TO CREATE A PRODUCTION ENVIRONNMENT. DONT USE IT FOR DEV !!\n\n   THIS SCRIPT HAS BEEN WELL-TESTED. HOWEVER, IF IT FAILS, DONT TRY TO RUN IT AGAIN, CONTACT DSI@N7CONSULTING.FR\n   and provide a detail of everything that is written on your console.\n\n   To get a SSL Certificate, it\'s better if you have already mapped a subdomain to that server\'s ip. If you didn\'t, stop that script or configure letsencrypt on your own.\n\n   You can get support by contacting dsi@n7consulting.fr\n\n   Are you ready to begin installation ?\n   "\n\n   read -p "Type Yes or no : " prompt\n   #if [[ $prompt =~ [yY](es)* ]]\n   if true\n   then\n       ${new_user} = ""\n       ${new_password} = "dummy"\n       ${new_password_confirm} = "dummy"\n       ${sub_domain} = ""\n       mkdir -p /var && mkdir -p /var/www && mkdir -p /var/www/html\n       cd /var/www/html\n       configure_user\n       init\n       configure_apache\n       install_mysql\n       install_composer\n       install_jeyser\n   else\n       break;\n   fi</code></pre>\n      </div>\n<h1 id="ssh-key-connection"><a href="#ssh-key-connection" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>SSH Key connection</h1>\n<p>Some of the providers don\'t allow connection with a password. Here is a guide on SSH key.\nBe warned that it\'s more difficult than password and requires more manipulations. On the other hand, it provides a better security\n(as long as you don\'t loose the key).</p>\n<p>That chapter is not a cryptography lesson. If you are interested in the background,\nplease refer to <a href="https://fr.wikipedia.org/wiki/Chiffrement_RSA" target="_blank" rel="nofollow noopener noreferrer">RSA encryption</a> and <a href="https://fr.wikipedia.org/wiki/Secure_Shell" target="_blank" rel="nofollow noopener noreferrer">Secure shell</a></p>\n<h2 id="on-windows"><a href="#on-windows" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>On Windows</h2>\n<p>If you need that authentication mode, the key creation process also uses Putty.</p>\n<p>If you haven\'t already, <a href="http://www.putty.org/" target="_blank" rel="nofollow noopener noreferrer">Download PuTTY</a>, a SSH client for Windows.</p>\n<p>Once Putty installed, launch Puttygen (provided with putty).</p>\n<ul>\n<li>As for "Number of bits in a generated key", choose <code>4096</code>.</li>\n</ul>\n\n  <a class="gatsby-resp-image-link" href="/static/putty-1-9326821df85eceb3956151f8a651ff88-88590.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 479px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 98.32985386221294%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Generate a 4096 bits key" title="" src="/static/putty-1-9326821df85eceb3956151f8a651ff88-88590.png" srcset="/static/putty-1-9326821df85eceb3956151f8a651ff88-f252e.png 163w,\n/static/putty-1-9326821df85eceb3956151f8a651ff88-49f8b.png 325w,\n/static/putty-1-9326821df85eceb3956151f8a651ff88-88590.png 479w" sizes="(max-width: 479px) 100vw, 479px">\n    </span>\n  </span>\n  \n  </a>\n    \n<ul>\n<li>Your key requires a source of randomness to be secure. Click on "Generate" and move your mouse in the frame.</li>\n</ul>\n\n  <a class="gatsby-resp-image-link" href="/static/putty-2-c18e18d69496df824aa9c319a06400f1-88590.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 479px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 98.53862212943632%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Move your mouse" title="" src="/static/putty-2-c18e18d69496df824aa9c319a06400f1-88590.png" srcset="/static/putty-2-c18e18d69496df824aa9c319a06400f1-f252e.png 163w,\n/static/putty-2-c18e18d69496df824aa9c319a06400f1-49f8b.png 325w,\n/static/putty-2-c18e18d69496df824aa9c319a06400f1-88590.png 479w" sizes="(max-width: 479px) 100vw, 479px">\n    </span>\n  </span>\n  \n  </a>\n    \n<ul>\n<li>You will the be asked a "Key passphrase", it is a password that will protect yout private key.</li>\n</ul>\n\n  <a class="gatsby-resp-image-link" href="/static/putty-3-138c6fb3985f2d34ad31d4c1d3645e4d-88590.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 479px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 98.32985386221294%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Add a passphrase" title="" src="/static/putty-3-138c6fb3985f2d34ad31d4c1d3645e4d-88590.png" srcset="/static/putty-3-138c6fb3985f2d34ad31d4c1d3645e4d-f252e.png 163w,\n/static/putty-3-138c6fb3985f2d34ad31d4c1d3645e4d-49f8b.png 325w,\n/static/putty-3-138c6fb3985f2d34ad31d4c1d3645e4d-88590.png 479w" sizes="(max-width: 479px) 100vw, 479px">\n    </span>\n  </span>\n  \n  </a>\n    \n<ul>\n<li>Vous pouvez ensuite sélectionner successivement "Save public key" et "Save private key" pour enregistrer les clés dans vos documents respectivement sous les noms "cle<em>publique" et "cle</em>privee".</li>\n</ul>\n<p>NOTE: Ces clés sont liées mais il n\'est pas possible de retrouver l\'autre si l\'une est perdue.\nVous devriez les conserver ensemble. Faites attention de ne pas les perdre sinon il faudra en créer de nouvelles.</p>\n<p>IMPORTANT: La clé privée ne doit être communiquée qu\'aux personnes physiques que vous autorisez à se connecter à votre serveur.</p>\n<p>Votre clé publique à saisir dans votre espace client <em>sur le site de votre hébergeur</em> se situe dans le cadre déroulant en haut de Putty et si besoin dans le fichier "cle_publique".</p>\n\n  <a class="gatsby-resp-image-link" href="/static/putty-4-3ad69068511ddd2cab596b623d1f595c-88590.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 479px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 35.07306889352818%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Add it to your provider" title="" src="/static/putty-4-3ad69068511ddd2cab596b623d1f595c-88590.png" srcset="/static/putty-4-3ad69068511ddd2cab596b623d1f595c-f252e.png 163w,\n/static/putty-4-3ad69068511ddd2cab596b623d1f595c-49f8b.png 325w,\n/static/putty-4-3ad69068511ddd2cab596b623d1f595c-88590.png 479w" sizes="(max-width: 479px) 100vw, 479px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Vous pouvez à présent la copier, fermer PuTTYgen et démarrer PuTTY.</p>\n<ul>\n<li>Dans le menu à gauche, sélectionnez "Connection" puis "SSH" puis "Auth".</li>\n</ul>\n\n  <a class="gatsby-resp-image-link" href="/static/putty-5-b4e45f301a345b61f75b2ddce01ab721-9bf92.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 452px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 98.00884955752213%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Auth through SSH" title="" src="/static/putty-5-b4e45f301a345b61f75b2ddce01ab721-9bf92.png" srcset="/static/putty-5-b4e45f301a345b61f75b2ddce01ab721-56de2.png 163w,\n/static/putty-5-b4e45f301a345b61f75b2ddce01ab721-2553d.png 325w,\n/static/putty-5-b4e45f301a345b61f75b2ddce01ab721-9bf92.png 452w" sizes="(max-width: 452px) 100vw, 452px">\n    </span>\n  </span>\n  \n  </a>\n    \n<ul>\n<li>Pour le champ "Private key file for authentication", cliquez sur "Browse" pour aller chercher le fichier "cle_privee".</li>\n</ul>\n\n  <a class="gatsby-resp-image-link" href="/static/putty-6-3d49eb4420de70ed143ed96d9dd7767c-0798b.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 453px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 24.061810154525386%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Choose your private key" title="" src="/static/putty-6-3d49eb4420de70ed143ed96d9dd7767c-0798b.png" srcset="/static/putty-6-3d49eb4420de70ed143ed96d9dd7767c-3cb6c.png 163w,\n/static/putty-6-3d49eb4420de70ed143ed96d9dd7767c-4dc70.png 325w,\n/static/putty-6-3d49eb4420de70ed143ed96d9dd7767c-0798b.png 453w" sizes="(max-width: 453px) 100vw, 453px">\n    </span>\n  </span>\n  \n  </a>\n    \n<ul>\n<li>Dans le menu à gauche, revenez à "Session".\nEntrez l\'adresse IP de votre serveur (ou le nom de domaine si vous en avez acheté un), laissez le port 22 et la connection de type SSH.</li>\n</ul>\n<p>Pour que toutes ces manipulations restent enregistrées dans Putty, vous pouvez donner un nom dans le champ "Saved Sessions" et cliquer sur "Save".</p>\n\n  <a class="gatsby-resp-image-link" href="/static/putty-7-42f903c5b2c81602d66bfdc4da9a33a3-9bf92.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 452px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 98.00884955752213%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Save everything" title="" src="/static/putty-7-42f903c5b2c81602d66bfdc4da9a33a3-9bf92.png" srcset="/static/putty-7-42f903c5b2c81602d66bfdc4da9a33a3-56de2.png 163w,\n/static/putty-7-42f903c5b2c81602d66bfdc4da9a33a3-2553d.png 325w,\n/static/putty-7-42f903c5b2c81602d66bfdc4da9a33a3-9bf92.png 452w" sizes="(max-width: 452px) 100vw, 452px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Tout est prêt, vous pouvez cliquer en bas sur "Open" pour vous connecter à votre serveur.</p>\n<p><strong>Warning</strong> If you loose the key, you might (depending on your provider) loose the access to your server.</p>'},navDoc:{edges:[{node:{title:"Installation",path:"install",items:[{id:"environment",title:"Environment",anchors:null},{id:"index",title:"Install Jeyser in minutes",anchors:null},{id:"update",title:"Update Jeyser",anchors:null},{id:"annexes",title:"Annexes",anchors:[{id:"help-for-manual-installation",title:"Help for manual installation"},{id:"ssh-key-connection",title:"SSH Key Connection"}]}]}},{node:{title:"Features",path:"features-fr",items:[{id:"gestion-associative",title:"Gestion associative",anchors:null},{id:"suivi-projet",title:"Suivi de projet",anchors:null},{id:"prospection",title:"Prospection",anchors:null},{id:"rh",title:"Relations humaines",anchors:null},{id:"tresorerie",title:"Trésorerie",anchors:null},{id:"formations",title:"Formations",anchors:null},{id:"indicateurs",title:"Indicateurs",anchors:null},{id:"documents-types",title:"Documents types",anchors:null},{id:"documents-types-faq",title:"FAQ Documents types",anchors:null},{id:"administration",title:"Administration",anchors:null},{id:"gdpr",title:"Règlement général sur la protection des données",anchors:null}]}},{node:{title:"User guides",path:"user-guides",items:[{id:"introduction-to-jeyser-1",title:"Introduction to Jeyser",anchors:null}]}},{node:{title:"Development",path:"dev",items:[{id:"faq",title:"FAQ",anchors:null},{id:"docker-architecture",title:"Architecture Docker",anchors:null},{id:"about",title:"About",anchors:null},{id:"demo-data",title:"Demo data",anchors:null},{id:"contributing",title:"Contributing",anchors:null}]}}]}},pathContext:{path:"docs/install/annexes",current:{path:"docs/install/annexes",title:"Installation - Annexes"},prev:{path:"docs/install/update",title:"Update Jeyser",rootPath:"Installation"},next:{path:"docs/features-fr/gestion-associative",title:"Features - Gestion associative"}}}}});
//# sourceMappingURL=path---docs-install-annexes-95f54e15a8e40c6ab939.js.map